import React from "react"
import Searchbar from "./Searchbar"
import Foodcard from "./Foodcard"
import { foodmenu } from "../utlis/data"

const Food = () => {
  return (
    <div className="food">
      <div className="searchbar">
        <Searchbar />
      </div>

      {foodmenu.map(item => (
        <Foodcard
          img={item.img}
          heading={item.name}
          ingredients={item.indrignts.map(item => item)}
          desc={item.desc}
          process={item.process.map(item => (
            <li>{item}</li>
          ))}
          alt={item.alt}
        />
      ))}
    </div>
  )
}
export default Food
